import React from "react";
import { Formulario, Label, Grupoinput, Input, LeyendaError, IconoValidacion, ContenedordeTerminos,
         ContenedorBotonCentrado, Boton, MensajedeExito, MensajedeError} from "./Elementos/Formulario";

import { faTriangleExclamation } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

import InputUsuario from "./Componentes/Input";

const App = () => {
  return (
      <main>
        <Formulario action="">
           <InputUsuario/>

        <ContenedordeTerminos>
          <Label>
            <input name="terminos" id="terminos" type="checkbox"/>
            Acepto los terminos y condiciones.
          </Label>
        </ContenedordeTerminos>
         {false && <MensajedeError>
          <p>
            <FontAwesomeIcon icon={faTriangleExclamation}/>
            <b>Error:</b> Por favor rellene el formulario correctamente.
        </p>
      </MensajedeError>}
      <ContenedorBotonCentrado>
        <Boton type="submit">Enviar</Boton>
        <MensajedeExito>Enviado exitosamente!</MensajedeExito>
        </ContenedorBotonCentrado>
       </Formulario>
      </main>
  );
}

export default App;
